import React from 'react'

const Content = () => {
  return (
    <div>
        <h2>School of Engineering, Thrikkakara</h2>
        <div className="para">
            <p>The School of Engineering was established in 1979 to offer part-time MTech programmes in the major disciplines of engineering (Civil, Mechanical, Electrical and Chemical Engineering) for practising engineers in and around Cochin. In 1995 the School introduced BTech programmes in Civil engineering, Mechanical engineering, Electronics and Communication engineering, Computer Science & Engineering and Information technology. Safety and Fire Engineering was added in 1996 and Electrical & Electronics Engineering in 2003.</p>
            p
      </div>
    </div>
  )
}

export default Content
